import React from 'react';
import {BrowserRouter, Route} from "react-router-dom";
import Header from "./components/Header";
import Footer from "./components/Footer";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Header></Header>

        <Footer></Footer>
      </div>
    </BrowserRouter>
  );
}

export default App;
